script: |
  super -f text -I q925.spq | sort > q925.out

inputs:
  - name: q925.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( - 46, col1, + - col1, - 73, col2 + - col0 * col1, - col0, col1 );
  - name: tab1

outputs:
  - name: q925.out
    data: |
      51	14	96
      85	5	59
      91	47	68
